import React from 'react';

function Header(props) {
    console.log(props)
    return (
        <React.Fragment>
        <header>
            <div className='header-content'>
                <p className='name' style={{margin: '0'}}>Opa<img src={require('../../Photos/key.png')} style={{width: '50px', margin: '0 0 3 -10px'}}></img></p>
                {props.isAuthenticated == false ? <button onClick={()=>{props.setAuthenticated(false)}}>Go back</button> : <button onClick={()=>{props.setAuthenticated(false)}}>Log out</button>}

            </div>
        </header>
        </React.Fragment>
    );
}

export default Header;
